contract Token {
    bytes32 public name;
    bytes32 public symbol;
    uint256 public totalSupply;
    uint8 public decimals;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;
    function transfer(address _to, uint256 _value)
        public
        returns (bool success);
    function approve(address _spender, uint256 _value)
        public
        returns (bool success);
    function transferFrom(address _from, address _to, uint256 _value)
        public
        returns (bool success);
}

contract HydroVaultContract is Ownable, Pausable {

    struct Vault {
        string vaultId;
        bool exists;
    }

    struct Transactions {
        address token;
        address sender;
        address recipient;
        uint256 amount;
    }
    uint256 public vaultCount;
    uint256 public transactionCount;

    string public signPrefix = "Signed for Vault Multisig:";

    mapping(address => mapping(address => uint256)) public tokens; //mapping of token addresses to mapping of account balances
    mapping(uint256 => Transactions) transactions;
    mapping(string => uint256) public metadata;
    mapping(uint256 => mapping(string => Vault)) private vault;
    mapping(address => mapping(address => bool)) private signers; 
    mapping(address => uint256) private numberOfSigners;
    mapping(address => uint256) private countSigners;

    event VaultCreated(uint256 indexed userId, string indexed vaultId);
    event Deposit(address token, address indexed sender, uint256 amount);
    event Withdraw(address token, address indexed sender, uint256 amount);
    event TransferSuccessful(
        address indexed token,
        address indexed sender,
        address indexed recipient,
        uint256 amount
    );
    event TransferFailed(
        address token,
        address indexed sender,
        address indexed recipient,
        uint256 amount
    );
    event signerAdded(address vaultAddress, address[] signerAddresses, uint256 maxSigners);

    function mintId(string memory email) internal pure returns (uint256) {
        bytes memory emailBytes = bytes(email);
        return uint256(keccak256(emailBytes));
    }
    function checkEmail(string memory email) internal returns (uint256) {
        uint256 userId = mintId(email);
        //check if the user's email is mapped already
        if (metadata[email] != 0) {
            return metadata[email];
        } else {
            metadata[email] = userId;
            return userId;
        }
    }

    function create(string memory email, string memory vaultId)
        public
        returns (bool)
    {
        bool exists = true;
        uint256 userId = checkEmail(email);
        require(!vault[userId][vaultId].exists, "Vault already exists");
        vault[userId][vaultId] = Vault(vaultId, exists);
        vaultCount++;
        emit VaultCreated(userId, vaultId);
        return true;
    }

    function prefixedHash(
        address signerAddress
    ) public view returns(bytes32) {
        bytes32 hash = keccak256(
          abi.encodePacked(
            signPrefix,
            address(this),
            signerAddress)
        );
        return hash;
    }

  function checkSigner(address signerAddress) public view returns (bool){
      return signers[msg.sender][signerAddress];
  }

