function addSigners(address[] memory signerAddresses, uint256 maxSigners, address vaultAddress) public returns(bool) {
    for (uint i=0; i<signerAddresses.length; i++) {
          signers[vaultAddress][signerAddresses[i]] = true;
      }
      numberOfSigners[vaultAddress] = maxSigners;
      emit signerAdded(vaultAddress, signerAddresses, maxSigners);
      return true;
  }

