function transferTokenMulti(
        address token,
        address recipient,
        uint256 value,
        uint256 countedSigners,
        address vaultAddress
    ) public whenNotPaused returns (bool) {
        address sender = vaultAddress;
        require(numberOfSigners[sender] == countedSigners, "The number of signers is not fulfilled");
        if (value > Token(token).allowance(sender, address(this))) {
            emit TransferFailed(token, sender, recipient, value);
            revert(
                "Value of tokens to transfer cannot be greater than approved token value"
            );
        }
        Token(token).transferFrom(sender, recipient, value);
        countSigners[sender] = 0;
        emit TransferSuccessful(token, sender, recipient, value);
        return true;
    }

    function transferToken(
        string memory email,
        address token,
        address recipient,
        uint256 value
    ) public whenNotPaused returns (bool) {
        address sender = msg.sender;
        if (value > Token(token).allowance(sender, address(this))) {
            emit TransferFailed(token, sender, recipient, value);
            revert(
                "Value of tokens to transfer cannot be greater than approved token value"
            );
        }
        uint256 userId = checkEmail(email);
        Token(token).transferFrom(sender, recipient, value);
        transactions[userId] = Transactions(token, sender, recipient, value);
        transactionCount++;
        emit TransferSuccessful(token, sender, recipient, value);
        return true;
    }

    function balanceOf(address token, address vaultAddress)
        public
        view
        returns (uint256)
    {
        require(token != address(0), "Token Address cannot be zero");
        return Token(token).balanceOf(vaultAddress);
    }

    function numberOfVaults() public view returns (uint256) {
        return vaultCount;
    }

    function numberOfTransactions() public view returns (uint256) {
        return transactionCount;
    }
